 Sure, here's an example of a React popup component that can be used as a module:
```jsx
import React from 'react';
import { useState } from 'react';

const Popup = (props) => {
  const [show, setShow] = useState(false);

  const toggleShow = () => {
    setShow(!show);
  };

  return (
    <div>
      <button onClick={toggleShow}>{props.buttonText}</button>
      {show && (
        <div style={{ position: 'absolute', top: '50%', left: '50%', transform: 'translate(-50%, -50%)' }}>
          <p>{props.message}</p>
        </div>
      )}
    </div>
  );
};

export default Popup;
```
In this example, the `Popup` component takes two props: `buttonText` and `message`. The component has an internal state `show` that determines whether the popup message should be displayed. When the button with `buttonText` is clicked, the `toggleShow` function is called which toggles the `show` state. The popup message is displayed only when `show` is true.

