 Here is an example of how you can serve a ReactJS app from an ExpressJS server using TypeScript:

1. Install the necessary dependencies by running the following command in your terminal:
```
npm install express react react-dom
```
2. Create a new folder for your project and create a new `index.ts` file inside it. You can use the following code to initialize your ExpressJS server:
```typescript
import express from 'express';
import React from 'react';
import ReactDOM from 'react-dom';

import App from './App';

const app = express();

app.get('/', (req, res) => {
  const appElement = ReactDOM.render(<App />, document.getElementById('root'));
});

app.listen(3000, () => {
  console.log('Server is running on port 3000...');
});
```
3. Create a new `App.tsx` file inside the same folder as your `index.ts` file. You can use the following code to define your React component:
```typescript
import React from 'react';

const App = () => {
  return (
    <div>
      <h1>Hello World</h1>
    </div>
  );
};

export default App;
```
4. Import the `App` component in the `index.ts` file and render it inside the `div` element with the id `root`.
5. Run the server by running the following command in your terminal:
```
node index.ts
```
You should now be able to access your ReactJS app by navigating to `http://localhost:3000` in your browser.

